import React from 'react';
import { Typography, Box } from '@mui/material';

const AcademicsSection = () => {
  return (
    <Box
      sx={{
        width: '100%',
        height: '200px', // Adjust height as needed
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        textAlign: 'center',
        background: 'linear-gradient(to bottom,#ffffff, #e0f7fa)', // Light blue to white gradient
        position: 'relative',
        color: '#333',
      }}
    >
      <Box
        sx={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          background: 'url(cloud-pattern.png) repeat', // Replace with cloud-like image or CSS pattern
          opacity: 0.3, // Adjust opacity to make it subtle
          zIndex: 1,
        }}
      />
      <Typography
        variant="h3"
        sx={{
          fontWeight: 'bold',
          fontSize: '2rem',
          zIndex: 2,
          fontFamily: 'serif',
        }}
      >
        Academics
      </Typography>
    </Box>
  );
};

export default AcademicsSection;
